import "./Footer.css";
import Facebook from "../Ui/Icons/Facebook";
import LInkedIn from "../Ui/Icons/LInkedIn";
import Instagram from "../Ui/Icons/Instagram";

const Footer = () => {
  return (
    <footer>
      <div className="footer_icons">
        <div>
          <Facebook />
        </div>
        <div>

        <Instagram />
        </div>
        <div>

        <LInkedIn />
        </div>
      </div>
    </footer>
  );
};

export default Footer;
